We conclude this section by noting that  more general solutions can be obtained by taking $\psi_1=\psi_1(\s)$ \cite{russo}. In this case the solutions interpolate smoothly between the cases described above.

We note that the same approach have been applied to the case of $M$-theory with $G_2$ holonomy \cite{nunez} where the logarithmic dependence of the energy on the spin $J$ for certain configurations was reproduced.

